import React from 'react';
import {Link, useParams} from 'react-router-dom'
import Sidebar from './Sidebar';
import {useEffect, useState} from 'react'
import axios from 'axios';

const baseUrl = 'http://127.0.0.1:8000/api';

function UserTrainingDetails(){

    //Fetch training details
    const [trainingData, settrainingData] = useState([]);
    const teacherId = localStorage.getItem("teacherId");
    useEffect(() => {
        try {
        axios.get(baseUrl + "/training-details/"+teacherId).then((res) => {
            // console.log(res)
            settrainingData(res.data);
        });
        } catch (error) {
        console.log(error);
        }
    }, []);


    //Fetch enrolled student
    // const [courseData, setCourseData] = useState([]);
    // useEffect(() => {
    //     try {
    //     axios.get(baseUrl + "/teacher-course/" + '1 0').then((res) => {
    //         setCourseData(res.data);
    //     });
    //     } catch (error) {
    //     console.log(error);
    //     }
    // }, []);

    return(
        <div className="container-fluid main_container mt-5">
      <div className="row">
        <aside className="col-md-3 "><Sidebar /></aside>
        <div className="col-md-7">
          <div className="card">
            <h5 className="card-header">Trainer Utilization</h5>
            <div className="card-body">
              <table className="table table-bordered">
                <thead>
                  <tr className='text-center'>
                    <th>Course</th>
                    <th>Date</th>
                    <th>From</th>
                    <th>to</th>
                    <th>Attendee(s)</th>  
                    <th>Meeting Link</th>
                  </tr>
                </thead>
                <tbody className='text-center'>
                {trainingData.map((training, index) => (
                    <tr>
                        <td>
                            <Link to={`/course-detail/`+training.course.id}>{training.course.title}</Link>
                        </td>
                        <td>
                            {training.date}
                            </td>
                        <td>
                            {training.f_time}
                        </td>
                        <td>
                            {training.t_time}
                        </td>

                        <td>
                            <Link to={`/teacher-detail/`+training.teacher.id}>
                              {training.teacher.full_name}</Link>
                        </td>
                        <td>
                            <Link target="blank" onClick={window.location.hreftraining.meeting_link}>{training.meeting_link}</Link>
                        </td>
                    </tr>
                ))}    
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
    )
}

export default UserTrainingDetails;
